import Footer from "./Footer";
import Header from "./Header";
import App from "../App";
import "../css/intro.css";
import { Routes, Route, Link } from 'react-router-dom';

const Intro = () => {
  return (
    <div>
      <Header />
      <div className="main-img">이미지영역</div>
      <div className="btn-group" role="group" aria-label="Basic mixed styles example">
        <Link to="/tutorial">
          <button type="button" className="btn btn-tutorial">튜토리얼</button>
        </Link>
        <Link to="/start">
          <button type="button" className="btn btn-start">시작하기</button>
        </Link>
        <button type="button" className="btn btn-metamask">
          <a href="chrome-extension://nkbihfbeogaeaoehlefnkodbefgpgknn/home.html#">메타마스크로 이동</a>
        </button>
      </div>
      <Routes>
        <Route path="/tutorial" element={<Intro />} />
        <Route path="/start" element={<App />} />
      </Routes>

      <Footer />
    </div>
  );
}

export default Intro;
